import { HashRouter as Router, Routes, Route } from 'react-router-dom';
import ExistingUser from './Components/ExistingUser.js'
import NewUser from './Components/NewUser.js';
import LoggedUser from './Components/LoggedUser.js';
import socketIO from 'socket.io-client';

const expressAppURL="http://localhost:3001/socket.io";
const socket=socketIO.connect(expressAppURL);
const App=()=>{
  return(
    <Router>
      <Routes>
        <Route path='/' element={<ExistingUser />} />
        <Route path='new' element={<NewUser />} />
        <Route path='loggedin' element={<LoggedUser />} />
      </Routes>
    </Router>
  )
}

export default App;
